import Dashboard from './Dashboard'
import ApplyForm from './ApplyForm';
import {Link, Route} from 'react-router-dom'

function NavBar() {
  return (
    <div>

      <div style={{display:'flex', justifyContent:'space-between'}}>

        <div style={{margin: 'auto', marginTop:"16px", marginBottom:"16px", color:''}}>
          <Link style={{ textDecoration: 'none', color:'white' }} to="/"><h3>Job Seekers</h3></Link>
        </div>

        <div style={{margin: 'auto', marginTop:"16px", marginBottom:"16px"}}>
          <Link style={{ textDecoration: 'none', color:'white'}} to="/admin"><h3>Admin Dashboard</h3></Link><br/>
        </div>

      </div>
      <Route path="/admin" component={Dashboard} exact/>
      <Route path="/" component={ApplyForm} exact/>

    </div>
  );
}

export default NavBar;
